function MainNav3(){

    const contextValue = useContext( ContextNom)
    const contextValue1 = useContext( ContextChoix)



    return(
        <div>
            <div className="div-MainNav">

                <div className="MainApp">

                  { contextValue1.choix } {' '}
                  { contextValue.theme1 } {' '} 
                  { contextValue.theme2 } {' '} 



                </div>
            </div>

        </div>
      );
      }

export default MainNav3;
